import React from "react";
import {NavbarData} from "./NavbarData";
import {Link} from "react-router-dom";
import styles from "./Navbar.css";
import SocialBar from "./SocialBar";

function Navbar(props){
  const isEmail = props.isEmail;
  const openModal = () => {
      alert("please")
  };
  return(
  <nav className = "tab" style = {{height: "500px"}}>
      <ul className = "tabs list-unstyled text-center">
        {NavbarData.map((item, index) => {
          if(item.cName = "Email"){
            return(
              <li key = {index} className = "tab py-4">
                <Link to = {item.path} isEmail = {item.isEmail} onClick = {openModal} className = {item.cName} style = {{textDecoration: "none"}}>
                  <span>{item.title}</span>
                </Link>
              </li>
            )
          }
          return(
            <li key = {index} className = "tab py-4">
              <Link to = {item.path} className = {item.cName} style = {{textDecoration: "none"}}>
                <span>{item.title}</span>
              </Link>
            </li>
          )
        })}
      </ul>
      <SocialBar/>
    </nav>
  );
}

export default Navbar;
